import React from 'react'
import './Music.sass'
import { ImSpotify } from 'react-icons/im';

function Music() {

    let client_id = '5523ece294ee4a3a9a70b4b288e6994a';
    let client_secred = '035176ad27ae4e5483e9c83afafbc325';
    let redirect_uri = 'http://localhost:3000/';

    return (
        <div className='music'>
            <div className='music-loggedin'>
                Logged in
            </div>
            <div className='music-loggedout'>
                <div className='music-loggedout-icon'>
                    <ImSpotify />
                </div>
                <div className='music-loggedout-button'>
                    Log in
                </div>
            </div>
        </div>
    )
}

export default Music
